  false,\n\t\"url\": null,\n\t\"notes\": \"To understand the tundra swan's habitat
  needs, population parameters and role as an ecological indicator, total censuses
  are needed, establishing a basis for comparison in future years. These data will
  also form the nucleus for a quadrant stratified sampling scheme almost as reliable
  as census data, ultimately at lower cost. Future survey data short of this goal
  will remain vulnerable to data discrepancy and open to speculative interpretation.
